import React, { useState } from "react";
import { useNavigate } from "react-router-dom";

function NewSubmission() {
  const navigate = useNavigate();

  const [formData, setFormData] = useState({
    name: "",
    college: "",
    dept: "",
    year: "",
    problem: null,
    code: null,
  });

  const handleChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.value,
    });
  };

  const handleFileChange = (e) => {
    setFormData({
      ...formData,
      [e.target.name]: e.target.files[0],
    });
  };

  const handleSubmit = async (e) => {
    e.preventDefault();

    const data = new FormData();
    data.append("name", formData.name);
    data.append("college", formData.college);
    data.append("dept", formData.dept);
    data.append("year", formData.year);
    data.append("problem", formData.problem);
    data.append("code", formData.code);

    const response = await fetch("http://localhost:5000/evaluate", {
      method: "POST",
      body: data,
    });

    if (response.ok) {
      const blob = await response.blob();
      const url = window.URL.createObjectURL(blob);
      const a = document.createElement("a");
      a.href = url;
      a.download = "Evaluation_Report.pdf";
      a.click();
    } else {
      alert("Evaluation failed. Please try again.");
    }
  };

  return (
    <div
      style={{
        minHeight: "100vh",
        background: "linear-gradient(135deg, #43cea2, #185a9d)",
        display: "flex",
        justifyContent: "center",
        alignItems: "center",
      }}
    >
      <div
        style={{
          background: "#ffffff",
          padding: "35px",
          width: "480px",
          borderRadius: "14px",
          boxShadow: "0px 12px 35px rgba(0,0,0,0.25)",
        }}
      >
        {/* Back Button */}
        <button
          onClick={() => navigate("/")}
          style={{
            background: "transparent",
            border: "none",
            color: "#185a9d",
            cursor: "pointer",
            marginBottom: "15px",
            fontSize: "14px",
          }}
        >
          â¬… Back to Dashboard
        </button>

        <h2 style={{ textAlign: "center", marginBottom: "25px" }}>
          New Project Submission
        </h2>

        <form onSubmit={handleSubmit}>
          {/* Text Inputs */}
          <input
            type="text"
            name="name"
            placeholder="Name"
            onChange={handleChange}
            required
            style={inputStyle}
          />

          <input
            type="text"
            name="college"
            placeholder="College"
            onChange={handleChange}
            required
            style={inputStyle}
          />

          <input
            type="text"
            name="dept"
            placeholder="Department"
            onChange={handleChange}
            required
            style={inputStyle}
          />

          <input
            type="text"
            name="year"
            placeholder="Year"
            onChange={handleChange}
            required
            style={inputStyle}
          />

          {/* Problem Statement Upload */}
          <div style={{ marginBottom: "18px" }}>
            <label style={labelStyle}>Problem Statement</label>
            <input
              type="file"
              name="problem"
              accept=".pdf,.doc,.docx,.txt"
              onChange={handleFileChange}
              required
              style={{ width: "100%" }}
            />
          </div>

          {/* Code ZIP Upload */}
          <div style={{ marginBottom: "28px" }}>
            <label style={labelStyle}>Code ZIP</label>
            <input
              type="file"
              name="code"
              accept=".zip"
              onChange={handleFileChange}
              required
              style={{ width: "100%" }}
            />
          </div>

          {/* Submit Button */}
          <button
            type="submit"
            style={{
              width: "100%",
              padding: "14px",
              background: "#43cea2",
              color: "#fff",
              border: "none",
              borderRadius: "10px",
              fontSize: "16px",
              cursor: "pointer",
            }}
          >
            ðŸš€ Evaluate Project
          </button>
        </form>
      </div>
    </div>
  );
}

/* Reusable Styles */
const inputStyle = {
  width: "100%",
  padding: "10px",
  marginBottom: "14px",
  borderRadius: "6px",
  border: "1px solid #ccc",
};

const labelStyle = {
  display: "block",
  marginBottom: "6px",
  fontWeight: "bold",
};

export default NewSubmission;
